"use strict";

// https://svgwg.org/svg2-draft/types.html#TermDetach
function detach(value) {
  if (typeof value === "string") {
    return;
  }

  throw new TypeError(`jsdom internal error: detaching object of wrong type ${value}`);
}
exports.detach = detach;

